    });


  return (
    <div>
      <form>
        <input name="title" handlechan value={note.title} placeholder="Title" />
        <textarea name="content" value={note.content} placeholder="Take a note..." rows="3" />
        <button>Add</button>
      </form>
    </div>
  );
}

export default CreateArea;
